data.ecai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===8){ //CAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.cai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"e94e990b-241b-4f3e-ad5d-bea7c7b0341e","type":"CustomJS"},{"attributes":{"dimension":1,"plot":{"id":"c2ef687e-c651-4f56-bd7f-eccdfc8f5a08","subtype":"Figure","type":"Plot"},"ticker":{"id":"48065d3a-d60b-4c48-a067-e8ed5226d608","type":"BasicTicker"}},"id":"fb164fe7-faa2-4b92-9d43-05bf0d2cca50","type":"Grid"},{"attributes":{"data_source":{"id":"934075af-cc21-4e3f-a151-129be1f60322","type":"ColumnDataSource"},"glyph":{"id":"d8a91a9f-cd77-48cb-a51b-d246e687eaed","type":"Square"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"486d7a08-ce21-4365-b0f4-1eff3045c7af","type":"Square"},"selection_glyph":null,"view":{"id":"33ff9a67-5da0-4975-ba93-e25a5077d24e","type":"CDSView"}},"id":"77a0253b-4724-49c3-a0b6-646d55e7ca60","type":"GlyphRenderer"},{"attributes":{"children":[{"id":"e9e1e479-f503-4fb5-88c8-aff9324f452e","type":"RadioButtonGroup"}]},"id":"14b2570a-c9ce-48d4-9e80-1af00f60e0f1","type":"WidgetBox"},{"attributes":{"fill_color":{"field":"color"},"line_color":{"field":"color"},"size":{"units":"screen","value":10},"x":{"field":"x"},"y":{"field":"y"}},"id":"a65fb52d-c870-4f07-b5a7-c45b6aaf3735","type":"Circle"},{"attributes":{"active":0,"callback":{"id":"e94e990b-241b-4f3e-ad5d-bea7c7b0341e","type":"CustomJS"},"labels":["show Cluster","show Doublon","show Nans","show KaKs_Scores","show similarity_scores","show Length","show gc","show ecai","show cai"]},"id":"e9e1e479-f503-4fb5-88c8-aff9324f452e","type":"RadioButtonGroup"},{"attributes":{"active_drag":"aut
